import { StayPrimaryLandscape } from "@mui/icons-material"
import { grey } from "@mui/material/colors"
import { makeStyles } from "@mui/styles"

const homeStyles = makeStyles (() =>({
    card:{
        maxWidth: 340,
        color: '#ffffff',
        borderRadius:'12%',
    },
    title:{
        marginLeft: '25px',
    },
    }
))

export default homeStyles
